<?php
    $user = $_GET["user"];
    $repo = $_GET["repo"];
    
    //SETTINGS-------------------------------------------
    $MAX_SHOWN_FORKERS = 4;
    
    $SCALE = 52;
    $PADDING = round(40 * ($SCALE / 100));
    $AVATAR_HEIGHT = round(120 * ($SCALE / 100));
    $AVATAR_MARGIN_RIGHT = round(15 * ($SCALE / 100));
    $AVATAR_MARGIN_BOTTOM = round(20 * ($SCALE / 100));
    $FONT_SIZE = round(32 * ($SCALE / 100));
    
    //FUNCTIONS-------------------------------------------
    function getGitHubAPIKey(){
        //FILL THIS IN YOURSELF IF YOU'RE HOSTING THIS. GET AN API KEY AS FOLLOWS:
        //https://docs.github.com/en/free-pro-team@latest/github/authenticating-to-github/creating-a-personal-access-token
        return "";
    }
    
    $widths = array();
    $im = new Imagick();
    $draw = new ImagickDraw();
    $draw->setFontSize($FONT_SIZE);
    function addWidth($text, $bold){
        global $im;
        global $draw;
        global $FONT_SIZE;
        global $widths;
        
        if(substr($text, 0, 1) == " "){
            $widths[] = $FONT_SIZE/4;
        }
        $draw->setFont("../fonts/open-sans" . ($bold == "bold" ? "-bold" : "") . ".ttf");
        $widths[] = $im->queryFontMetrics($draw, trim($text))["originX"];
    }
    
    $rawSVGTextString = "";
    $svgTextString = "";
    $blueUsed = false;
    function addText($text, $bold, $blue = false){
        global $svgTextString;
        global $rawSVGTextString;
        global $blueUsed;
        
        $svgTextString .= (substr($text, 0, 1) == " " ? " " : "") . ($bold == "bold" ? "<tspan" . ($blue ? " class=\"blue\"" : "") . ">" : "") . trim($text) . ($bold == "bold" ? "</tspan>" : "");
        $rawSVGTextString .= $text;
        
        if($blue) $blueUsed = true;
        
        addWidth($text, $bold);
    }
    
    function doneAddingText(){
        global $widths;
        global $im;
        global $draw;
        
        $im->destroy();
        $draw->destroy();
    }
    
    function grabFrom($url){
        $ch = curl_init();
        curl_setopt($ch, CURLOPT_HTTPHEADER, array("Authorization: token " . getGitHubAPIKey()));
        curl_setopt($ch, CURLOPT_USERAGENT, "My User Agent");
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
        curl_setopt($ch, CURLOPT_URL, $url);
        $data = curl_exec($ch);
        curl_close($ch);
        
        return $data;
    }
    
    function convertGitHubImageURLToSmallVersionURL($url){
        global $AVATAR_HEIGHT;
        $SMALL_SIZE = round($AVATAR_HEIGHT * 1.5);
        
        $paramsIndex = strpos($url, "?");
        if($paramsIndex === false){
            return $url . "?s=" . $SMALL_SIZE;
        }
        
        if($paramsIndex == strlen($url) - 1){
            return $url . "s=" . $SMALL_SIZE;
        }
        
        $isFirstParam = true;
        $sParamIndex = strpos($url, "?s=");
        if($sParamIndex === false){
            $sParamIndex = strpos($url, "&s=");
            $isFirstParam = false;
        }
        
        if($sParamIndex === false){
            return $url . "&s=" . $SMALL_SIZE;
        }
        
        $endOfSParamIndex = strpos($url, "&", $sParamIndex + 1);
        if($endOfSParamIndex === false){
            return substr($url, 0, $sParamIndex) . "&s=" . $SMALL_SIZE;
        }
        
        return substr($url, 0, $sParamIndex) . ($isFirstParam ? "?" : "&") . "s=" . $SMALL_SIZE . substr($url, $endOfSParamIndex);
    }
    
    function getMostRecentForkers($user, $repo, $numberOfForkers){
        global $MAX_SHOWN_FORKERS;
        
        $mostRecentForkers = array();
        
        $firstPageData = json_decode(grabFrom("https://api.github.com/repos/$user/$repo/forks?sort=newest"), true);
        if(!is_array($firstPageData)) return getForkersWithFileGetContents($user, $repo, $numberOfForkers);
        
        $firstPageCount = count($firstPageData);
        
        for($i = 0; $i < min($firstPageCount, $MAX_SHOWN_FORKERS); $i++){
            if(!array_key_exists("owner", $firstPageData[$i]) || !array_key_exists("login", $firstPageData[$i]["owner"]) || !array_key_exists("avatar_url", $firstPageData[$i]["owner"])) return getForkersWithFileGetContents($user, $repo, $numberOfForkers);
            $mostRecentForkers[] = array($firstPageData[$i]["owner"]["login"], $firstPageData[$i]["owner"]["avatar_url"]);
        }
        
        return $mostRecentForkers;
    }
    
    function getForkersWithFileGetContents($user, $repo, $numberOfForkers){
        global $MAX_SHOWN_FORKERS;
        
        $CONTAINER_ID = "network";
        $UNIQUE_IMG_CLASS = "avatar-user";
        
        $mostRecentForkers = array();
        
        $html = file_get_contents("https://github.com/$user/$repo/network/members");
        
        $containerIndex = strpos($html, "id=\"" . $CONTAINER_ID . "\"");
        if($containerIndex === false) return false;
        
        $html = substr($html, $containerIndex);
        
        $lastIMGClassIndex = -1 * strlen($UNIQUE_IMG_CLASS);
        for($i = 0; $i < $MAX_SHOWN_FORKERS; $i++){
            $lastIMGClassIndex = strpos($html, $UNIQUE_IMG_CLASS, $lastIMGClassIndex + strlen($UNIQUE_IMG_CLASS));
            if($lastIMGClassIndex === false) break;//we ran out of users
            
            if($i == 0) continue;//so we don't incude the owner
            
            $endOfImgIndex = strpos($html, ">", $lastIMGClassIndex);
            if($endOfImgIndex === false) return false;
            
            $imgString = substr($html, $lastIMGClassIndex, $endOfImgIndex - $lastIMGClassIndex);
            
            $altIndex = strpos($imgString, "alt=\"");
            if($altIndex === false) return false;
            
            $endOfAltIndex = strpos($imgString, "\"", $altIndex + 5);
            if($endOfAltIndex === false) return false;
            
            $alt = str_replace("@", "", substr($imgString, $altIndex + 5, $endOfAltIndex - ($altIndex + 5)));
            if($alt == "") return false;
            
            $login = $alt;
            
            $srcIndex = strpos($imgString, "src=\"");
            if($srcIndex === false) return false;
            
            $endOfSRCIndex = strpos($imgString, "\"", $srcIndex + 5);
            if($endOfSRCIndex === false) return false;
            
            $src = substr($imgString, $srcIndex + 5, $endOfSRCIndex - ($srcIndex + 5));
            if($src == "") return false;
            
            $avatarURL = convertGitHubImageURLToSmallVersionURL($src);
            
            $mostRecentForkers[] = array($login, $avatarURL);
        }
        
        return $mostRecentForkers;
    }
    
