    function getErrorSVG(){
        $svg = "<svg xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" width=\"354\" height=\"131\" role=\"img\" aria-label=\"Image not produced.\">";
        $svg .=     "<title>Image not produced.</title>";
        $svg .=     "<rect width=\"100%\" height=\"68%\" y=\"16%\" fill=\"#f6f8fa\"/>";
        $svg .= "</svg>";
        return $svg;
    }
    
    function dieSVG($svg){
        header("Content-Type: image/svg+xml");
        header('Cache-Control: max-age=5, s-maxage=5');
        header('Expires: '.gmdate('D, d M Y H:i:s \G\M\T', time() + 5));
        die(str_replace("&", "&amp;", $svg));
    }
    
    //DATA AND STANDARD ERROR IMAGES-------------------------------------------
    $repoData = json_decode(grabFrom("https://api.github.com/repos/$user/$repo"), true);
